<script>

//pomocna funkce	
String.prototype.replaceAll = function(str1, str2, ignore)
{
   return this.replace(new RegExp(str1.replace(/([\,\!\\\^\$\{\}\[\]\(\)\.\*\+\?\|\<\>\-\&])/g, function(c){return "\\" + c;}), "g"+(ignore?"i":"")), str2);
};

Date.prototype.addHours= function(h){
    this.setHours(this.getHours()+h);
    return this;
}
function timestr(date){
    h= date.getHours(),
    m= date.getMinutes(),
    s= date.getSeconds();
    if(h<10) h= '0'+h;
    if(m<10) m= '0'+m;
    if(s<10) s= '0'+s;
    return $.datepicker.formatDate('yy/mm/dd ', date)+h+':'+m+':'+s+' +0000';
}

function converter(x)
{
  var lastk = null;
  var laststart = null;
  for (var k in x)
  {
    laststart = x[k].start;
    x[k].start = x[k].start.replaceAll("-", "/")+' +0000';
    x[k].end = x[k].start.replaceAll("-", "/")+' +0000';
    if (lastk != null)
    {
      x[lastk].end = x[k].start;
    }
    lastk = k;
  }

  x[lastk].end = timestr((new Date(laststart)).addHours(1));
  
  return x;
}
